import React from "react";
import "./NavBar.css";
import { NavLink } from "react-router-dom";
import { useIsAuthenticated, useAuthUser } from "react-auth-kit";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faHouse,
  faAddressCard,
  faInfo,
  faPersonChalkboard,
  faBoxArchive,
  faGraduationCap,
  faRightFromBracket,
  faPlug,
} from "@fortawesome/free-solid-svg-icons";

const NavigationBar = () => {
  const authUser = useAuthUser();
  const isAuthenticated = useIsAuthenticated();
  return (
    <nav>
      <ul className="side left-side">
        <a
          id="home"
          href="/"
          className={({ isActive }) => (isActive ? "active" : undefined)}
          end
        >
          <FontAwesomeIcon icon={faHouse} /> Home
        </a>

        <a
          href="contact"
          className={({ isActive }) => (isActive ? "active" : undefined)}
        >
          <FontAwesomeIcon icon={faAddressCard} /> Contact
        </a>

        <a
          href="about"
          className={({ isActive }) => (isActive ? "active" : undefined)}
        >
          <FontAwesomeIcon icon={faInfo} />
          About
        </a>

        {isAuthenticated() && (
          <a
            href="presentation"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            <FontAwesomeIcon icon={faPersonChalkboard} /> new Lecture
          </a>
        )}

        {isAuthenticated() && (
          <a
            href="activePresentations"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            <FontAwesomeIcon icon={faBoxArchive} /> Active Lectures
          </a>
        )}
      </ul>

      <ul className="side right-side">
        {isAuthenticated() && (
          <a
            id="contact-sales"
            href="joinALecture"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            Join a lecture
          </a>
        )}

        {isAuthenticated() && (
          <a
            href="signOut"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            <FontAwesomeIcon icon={faRightFromBracket} /> Sign Out
          </a>
        )}

        {!isAuthenticated() && (
          <a
            id="sign-up"
            href="register"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            <FontAwesomeIcon icon={faGraduationCap} /> Sign Up
          </a>
        )}

        {!isAuthenticated() && (
          <a
            href="login"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            <FontAwesomeIcon icon={faPlug} /> Log in
          </a>
        )}
      </ul>
    </nav>
    // {isAuthenticated() && (
    //   <div className="user-greeting">Hello {authUser().firstName}</div>
    // )}
  );
};

export default NavigationBar;
